module `IP_MODULE_NAME(efx_resetsync) #(
    parameter ASYNC_STAGE = 2,
    parameter ACTIVE_LOW = 1
) (
    input  wire             clk,
    input  wire             reset,
    output wire             d_o
);

(* async_reg = "true" *) reg [ASYNC_STAGE-1:0] async_reg;

assign d_o = async_reg[ASYNC_STAGE-1];

genvar i;
generate
   if (ACTIVE_LOW == 1) begin: active_low
      always @ (posedge clk or negedge reset)
      begin
          if(!reset) begin
              async_reg[0]         <= 1'b0;
          end
          else begin 
              async_reg[0]         <= 1'b1;
          end
      end
          
      for (i=1; i<ASYNC_STAGE; i=i+1) begin
          always @ (posedge clk or negedge reset)
          begin
              if(!reset) begin
                  async_reg[i]         <= 1'b0;
              end
              else begin 
                  async_reg[i]         <= async_reg[i-1];
              end
          end
      end
   end
   else begin: active_high
      always @ (posedge clk or posedge reset)
      begin
          if(reset) begin
              async_reg[0]         <= 1'b1;
          end
          else begin 
              async_reg[0]         <= 1'b0;
          end
      end
          
      for (i=1; i<ASYNC_STAGE; i=i+1) begin
          always @ (posedge clk or posedge reset)
          begin
              if(reset) begin
                  async_reg[i]         <= 1'b1;
              end
              else begin 
                  async_reg[i]         <= async_reg[i-1];
              end
          end
      end
   end
endgenerate

endmodule


